import http from "../http-common";

const getAll = () => {
  return http.get('/filmek');
};

const get = (id) => {
    return http.get(`/filmek/${id}`);
  };

  const create = (data) => {
    return http.post(`/filmek`, data);
  };

  const remove = (id) => {
    return http.delete(`/filmek/${id}`);
  };

  const put = (id) => {
    return http.put(`/filmek/${id}`);
  };
  const filmService = {
    getAll,
    get,
    create,
    remove, 
    put
  };

  export default filmService;
